                <li><a class="action-link" href="mailto:?body=F%2FA-18%20Super%20Hornet%20caused%20sonic%20boom%20some%20believed%20was%20quake%0A%0Ahttps%3A%2F%2Fwww.latimes.com%2Flocal%2Flanow%2Fla-me-ln-fa18-super-hornet-sonic-boom-quake-20140410-story.html%0A%0AIt%20was%20a%20lone%20F%2FA-18%20Super%20Hornet%20fighter%20jet%20that%20produced%20the%20sonic%20boom%20Wednesday%20that%20produced%20the%20rumbling%20so%20intense%20some%20Los%20Angeles%20and%20Orange%20County%20residents%20insisted%20it%20was%20an%20earthquake.%20" data-social-service="email">
