                                            <div class="page-article-body">
                                                <div class="rich-text-article-body"><div class="rich-text-article-body-content rich-text-body" data-subscriber-content=""><p>It was a lone F/A-18 Super Hornet fighter jet that produced the sonic boom Wednesday that produced the rumbling so intense some Los Angeles and Orange County residents insisted it was an earthquake.</p><p>The confirmation Thursday from the U.S. Navy came as some questioned that the rumbling came from an aircraft, while others suggested it was a test of the fabled Aurora spy plane.</p><p>Its maddening these things draw up these conspiracy theories, said Peter Merlin, an aerospace historian and an author on military and experimental aircraft.</p><p>The F/A-18 jet was flying in the Pacific Ocean about 35 miles southwest of San Diego when it flew faster than the speed of sound, said Navy Cmdr. Kevin Stephens.</p><div class="enhancement" data-align-center="" data-click="enhancement" style="display: none;">
    <div class="google-dfp-ad-wrapper" style="min-height: 270px" data-min-height="270" data-ad-rendered="true">
    <div class="google-dfp-ad-caption">Advertisement</div>
    <div id="google-ad6159038a-a4a5-4a27-8f89-2ab5dbc00350" class="google-dfp-ad injected" data-slot-name="/21787098806/web.latimes/california" data-slot-sizes="[[5, 1]]" data-module-targeting="{&quot;instart&quot;: &quot;false&quot;}" data-current-size="[5,1]" data-google-query-id="CODVuqrdh_QCFZHahgodUQgOzA" data-hold-size="[5,1]"><div id="google_ads_iframe_/21787098806/web.latimes/california_4__container__" style="border: 0pt none;"><iframe id="google_ads_iframe_/21787098806/web.latimes/california_4" title="3rd party ad content" name="google_ads_iframe_/21787098806/web.latimes/california_4" width="5" height="1" scrolling="no" marginwidth="0" marginheight="0" frameborder="0" data-google-container-id="5" style="border: 0px; vertical-align: bottom;" data-load-complete="true"></iframe></div></div>
</div>

</div><p>Because the jet was headed in a northern and northwest direction, the sonic boom produced by the fighter jet headed toward the coast of Los Angeles and Orange counties  more than 100 miles away.</p><p>The sound will propagate in the direction its flying, Stephens said. The speed of sound is about 761 miles per hour.</p><p>The jet was flying as part of a demonstration of the U.S.S. Ronald Reagan aircraft carrier, which was on a daylong open house cruise out of its home port in Coronado.</p><p>It allows family members, spouses and kids to come out and experience for one day what life is like out at sea, Stephens said. The F/A-18 had flown from Naval Air Station Lemoores VFA-137 squadron in central California.</p><div class="enhancement" data-align-center="" data-click="enhancement">
    <ps-nativo-module data-fetch-offset="1.0" data-integration-script="https://s.ntv.io/serve/load.js">
    <div id="nativo_1"><script type="text/javascript" src="//ib.3lift.com/ttj?inv_code=LAT_ARC_Desktop_local_article" tl_id="97433"></script>  <script type="text/javascript">     var script = document.createElement("script");      script.type = "text/javascript";     script.src="//ib.3lift.com/ttj?inv_code=LAT_ARC_Desktop_local_article";     var child = document.getElementById("ntv-LAT_ARC_Desktop_local_article");     child.parentNode.insertBefore(script, child);   child.parentNode.removeChild(child);  </script></div>
</ps-nativo-module>

</div><p>While some may equate sonic booms to sounding like sharp cracks, the farther away you are from the jet, the more likely you might hear a rumbling sound that can shake buildings.</p><p>NASA aerospace engineer Edward Haering compared it to lightning strikes. The closer you are to the lightning, the more likely youll hear a sharp crack. The farther away you are, the more likely youll hear a rumble.</p><p>It actually can shake the house. If you have a large building, the pressure hits the wall and vibrates it, and so the room will kind of vibrate a little bit, said Haering, who works at the NASA Armstrong Flight Research Center in Edwards, Calif.</p><p>Sonic booms are produced when aircraft go faster than the speed of sound. They are like a 3-D version of the V-shaped waves that can be seen in the wake of a moving motor boat.</p><p>Instead of choppier water, the sonic boom vibrates the air, making a loud sound.</p><p>Haering said it can be hard for pilots to know where and how far sonic booms will travel. A lot depends on the weather and the direction of the wind, which helps determine where the sound will go.</p><p>Were working on efforts to make quiet supersonic aircraft that wont disturb people, Haering said.</p><p>Its understandable that people might be spooked by hearing a sonic boom along the L.A. and Orange County coast, experts said. Sonic booms would be more expected over Edwards Air Force base, for instance.</p><p>Sometimes, you see something out of context, and sometimes, its a little mysterious, said Merlin, the aerospace historian.</p><p>Wednesdays sonic boom as well as earlier similar incidents have caused some to speculate it could be the testing of the mythical top-secret Aurora spy plane project.</p><p>Merlin said Aurora is a fantasy, based on a misreading of a federal budget document in the 1990s as the government phased out the SR-71 Blackbird spy plane. Some thought Aurora was to be its replacement, but in fact, it was the codename of the well-known B-2 stealth bomber, which does not fly faster than the speed of sound, Merlin said.</p><p>The F/A-18 is a twin-engine fighter jet made by Boeing Co. that has been a fixture on U.S. Navy aircraft carriers since 1983. The plane is flown by the Blue Angels, the Navys flying aerobatic team.</p><p>The Super Hornet version of the aircraft became operational in 2001.</p><p>The aircrafts fuselage sections are manufactured by Northrop Grumman Corp. in Los Angeles, in a 1-million-square-foot facility on Aviation Boulevard, about a mile south of Los Angeles International Airport.</p><p>Its not uncommon for sonic booms to be mistaken for earthquakes. In February, residents along the Maryland coast were startled and reported floors shaking and doors rattling.</p><p>The boom coincided with a flight of supersonic jets, an F-35C and an F/A-18, flying from Patuxent Naval Air Station, the Baltimore Sun <a class="link" href="https://articles.baltimoresun.com/2014-02-07/travel/bal-earthquake-ocean-city-20140206_1_magnitude-ocean-city-earthquake" target="_blank">reported</a>. </p><p>Scott Conner, who lives in the Big Rock neighborhood of Malibu, said Wednesday he was convinced the shaking was a quake.</p><p>He said the shaking was so intense one of his computer monitors wouldve tipped over if he wasnt there to steady it.</p><p>I had to put out my hand to keep it from tipping over, Conner said in a telephone interview.</p><p>I thought it was the biggest quake Ive ever been in. This thing was big, big, he said. The whole house just lifted.</p><p>Kit Fox, who works at Rancho Palos Verdes City Hall, said people walked out of their offices after being rattled.</p><p>It was really just a short, sharp jolt, I think the shaking went on for about 3 to 5 seconds at most, but it definitely rattled people, he said.</p><p>Fox said it felt more like the building shaking rather than the ground shaking.</p><p> </p><p><runtime:include slug="la-me-ln-alsos"> </runtime:include></p><p>Twitter: <a class="link" href="https://www.twitter.com/ronlin" target="_blank">@ronlin</a><b> | </b><a class="link" href="https://www.facebook.com/ronlin2" target="_blank">Facebook</a><b> | </b><a class="link" href="https://plus.google.com/#111507167675506654160/" target="_blank">Google+</a><b></b></p><p><a class="link" href="mailto:ron.lin@latimes.com" target="_blank">ron.lin@latimes.com</a></p><p><i>Times staff writer W.J. Hennigan contributed to this report.</i></p></div></div>
